	add("nature", "{\"term\":\"nature\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"old norse\"], \"text\":\"From Middle english (1100-1500) {{m|enm|nature|natur, nature}}, from Old french (842-ca. 1400) {{m|fro|nature}}, from Latin {{m|la|nātūra||birth, origin, natural constitution or quality}}, future participle from perfect passive participle {{m|la|natus|(g)natus|born}}, from deponent verb {{m|la|nasci|(g)nasci|to be born, originate}} + future participle suffix \u0027-urus\u0027 Displaced native Middle english (1100-1500) {{m|enm|cunde|cunde, icunde|nature, property, type, genus, character}} (from Old english (ca. 450-1100) {{m|ang|ġecynd}}), Middle english (1100-1500) {{m|enm|lund||nature, disposition}} (from Old norse {{m|non|lund}}), Middle english (1100-1500) {{m|enm|burthe||nature, birth, nation}} (from Old english (ca. 450-1100) {{m|ang|ġebyrd}} and Old norse {{m|non|*byrðr}}). More at {{l|en|kind}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The natural world; consisting of all things unaffected by or predating human technology, production and design. e.g. the ecosystem, the natural environment, virgin ground, unmodified species, laws of nature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1800-1859\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Nature\u0027\u0027 has caprices which art cannot imitate\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Nature\u0027\u0027 has good intentions, of course, but, as Aristotle once said, she cannot carry them out. When I look at a landscape I cannot help seeing all its defects\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The innate characteristics of a thing. What something will tend by its own constitution, to be or do. Distinct from what might be expected or intended\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, \u0027\u0027, Ch.1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Being by \u0027\u0027nature\u0027\u0027 of a cheerful disposition, the symptom did not surprise his servant, late private of the same famous regiment, who was laying breakfast in an adjoining room\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1869\u0027\u0027, \u0027s:Mark the Match Mark the Match Boy\u0027, s:Mark the Match Boy/Chapter Ch.16\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Mark hardly knew whether to believe this or not. He already began to suspect that Roswell was something of a humbug, and though it was not in his \u0027\u0027nature\u0027\u0027 to form a causeless dislike, he certainly did not feel disposed to like Roswell\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The summary of everything that has to do with biological, chemical and physical states and events in the physical universe\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1608-1674\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"I oft admire / How \u0027\u0027Nature\u0027\u0027, wise and frugal, could commit / Such disproportions\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/feature/2012/1/how-to-be-manipulative How to Be passage\u003dAs in much of biology, the most satisfying truths in ecology derive from manipulative experimentation. Tinker with \u0027\u0027nature\u0027\u0027 and quantify how it responds\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Conformity to that which is natural, as distinguished from that which is artificial, or forced, or remote from actual experience\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"c.1564–1616\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"One touch of \u0027\u0027nature\u0027\u0027 makes the whole world kin\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Kind, sort; character; quality\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"1631-1700\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A dispute of this \u0027\u0027nature\u0027\u0027 caused mischief\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Carried somehow, somewhither, for some reason, on these surging floods, were these travelers, of errand not wholly obvious to their fellows, yet of such sort as to call into query alike the \u0027\u0027nature\u0027\u0027 of their errand and their own relations\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Physical constitution or existence; the vital powers; the natural life\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"c.1564–1616\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"my days of \u0027\u0027nature\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"c.1564–1616\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"Oppressed \u0027\u0027nature\u0027\u0027 sleeps\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Natural affection or reverence\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"1688-1744\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"Have we not seen / The murdering son ascend his parent\u0027s bed, / Through violated \u0027\u0027nature\u0027\u0027 force his way\", \"priority\":28}]}, \"synonyms\":{}}");

